import styled, { keyframes } from 'styled-components';

const Animaition = () => {
	return (
		<Container>
			<FlowBox>
				<FlowWrap>
					<Flow>
						<p>HTML</p>
						<p>CSS</p>
						<p>JQUERY</p>
						<span>JAVASCRIPT</span>
						<p>HTML</p>
						<p>CSS</p>
						<p>JQUERY</p>
						<span>JAVASCRIPT</span>
						<p>HTML</p>
						<p>CSS</p>
						<p>JQUERY</p>
